                <div className="contents">
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                    <p>react</p>
                </div>
            </div>
        </>
    );
}
export default Footer;
